function findNearN(v,n)
{
    let diss=Array(colors.length);
    colors.forEach((c,i)=>
    {
        diss[i]=[i,c.reduce((a,c,i)=>a+(c-v[i])**2,0)];
    });

    return diss.sort((a,b)=>a[1]-b[1]).slice(0,n).map(x=>
    {
        let c=colors[x[0]];
        let p=c2p[c.map(x=>x.toString(16).padStart(2,'0')).join('')];
        return[c,p];
    });
}